import { StatusBar } from 'expo-status-bar';
import React, { Component } from 'react';
import { StyleSheet, TouchableOpacity, View } from 'react-native';
import { globalStyle } from '../../../assets/global.style';
import Card from '../../shared/card';
import { AntDesign } from '@expo/vector-icons'

export default class Controls extends Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <Card style={ globalStyle.controls }>
                <TouchableOpacity>
                    <AntDesign name="stepbackward" size={38} color="black" />
                </TouchableOpacity>
                <TouchableOpacity>
                    <AntDesign name="caretright" size={46} color="black" />
                </TouchableOpacity>
                <TouchableOpacity>
                    <AntDesign name="stepforward" size={38} color="black" />
                </TouchableOpacity>
            </Card>
        );
    }
}

const styles = StyleSheet.create({
    song: {
        fontSize: 26,
        color: 'black',
        fontWeight: '500',
        textAlign: 'center',
        marginBottom: 6
    },
    artiste: {
        fontSize: 22,
        color: 'red',
        textAlign: "center",
        marginTop: 6,
        backgroundColor: '#eee',
        padding: 3,
        borderRadius: 10,
        marginHorizontal: -5
    },
    separator: {
        width: 70
    }
})
